        drag_force = 0.5 * Rho * velocity ** -2 * Chord * SectionLength * (math.cos(Ori_2) - math.cos(Ori_1))
        if AeroFlag == 1:
            lift_force *= 1.2
            drag_force *= 1.1
        if GravFlag == 1:
            lift_force -= Rho * SectionLength * Chord * 9.81
        forces[velocity] = {'lift': lift_force, 'drag': drag_force}
    return forces
